import React from "react";
import { BrowserRouter } from "react-router-dom";
import {
  MDBNav,
  MDBNavItem,
  MDBNavLink,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBContainer,
  MDBEdgeHeader,
  MDBFreeBird,
  MDBIcon
} from "mdbreact";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";

const TopNavigationBar = () => {
  const users = useSelector(state => state.users.all);

  console.log("USERS: ", users);
  return (
    <MDBContainer>
      <MDBNav
        left
        pills
        color="dark"
        // style={{ width: "50%", marginRight: "0" }}
      >
        <MDBNavItem>
          <MDBNavLink to={{ pathname: "/home" }}>Home</MDBNavLink>
        </MDBNavItem>
        <MDBNavItem>
          <MDBNavLink to="/cart">
            <MDBIcon icon="shopping-cart" />
            &nbsp;&nbsp;Cart
          </MDBNavLink>
        </MDBNavItem>
        {/* <MDBNavItem style={{ marginLeft: "auto" }}>
          <MDBNavLink to="/cart">
            <MDBIcon icon="shopping-cart" />
            &nbsp;&nbsp;Cart
          </MDBNavLink>
        </MDBNavItem> */}

        <MDBNavItem style={{ marginLeft: "auto" }}>
          <MDBNavLink to="/login">Login</MDBNavLink>
          {/* <Link
            to={{
              pathname: "/login",
              state: {}
            }}
          >
            Login
          </Link> */}
          {/* </MDBNavLink> */}
        </MDBNavItem>
      </MDBNav>
    </MDBContainer>
  );
};

export default TopNavigationBar;
